import React from 'react';

import {
    AppstoreOutlined,
    BarChartOutlined,
    CloudOutlined,
    ShopOutlined,
    TeamOutlined,
    UploadOutlined,
    UserOutlined,
    VideoCameraOutlined,
} from '@ant-design/icons';
import { Avatar, Space } from 'antd';
import { Layout, Menu, theme } from 'antd';
import { Typography } from 'antd';
const { Text, Link } = Typography;
const { Header, Content, Footer, Sider } = Layout;
const items = [
    UserOutlined,
    VideoCameraOutlined,
    UploadOutlined,
    BarChartOutlined,
    CloudOutlined,
    AppstoreOutlined,
    TeamOutlined,
    ShopOutlined,
    ShopOutlined,
    ShopOutlined,
    ShopOutlined,
    ShopOutlined,
].map((icon, index) => ({
    key: String(index + 1),
    icon: React.createElement(icon),
    label: `nav ${index + 1}`,
}));
const Payments = () => {
    const {
        token: { colorBgContainer, borderRadiusLG },
    } = theme.useToken();
    return (
        <Layout hasSider>
            <Sider
                style={{
                    overflow: 'auto',
                    height: '100vh',
                    position: 'fixed',
                    left: 0,
                    top: 0,
                    bottom: 0,
                    width:'-50vh'
                }}
            >
                <div className="demo-logo-vertical" style={{display:"flex",padding:"5%",paddingTop:"10%"}}>
                <Avatar shape="square" size={55} icon={<UserOutlined />} style={{ marginRight: '10px' }} />                    {/* <div >

        <Text strong style={{color:"white"}}>Nishyan</Text>
        <Link href="https://ant.design" target="_blank"></Link>
        </div> */}
                    <Space direction="vertical">
                        <Text strong style={{ color: "white" }}>Nishyan</Text>
                        <Link href="https://ant.design" target="_blank" style={{ color: "white", fontSize: "12px", textDecoration: "underline" }}>
      Visit store
    </Link>
                    </Space>
                </div>

                <Menu theme="dark" mode="inline" defaultSelectedKeys={['4']} items={items} />

                <div className="demo-logo-vertical" style={{display:"flex",padding:"5%",paddingTop:"10%",marginBottom:""}}>
                <Avatar shape="square" size={55} icon={<UserOutlined />} style={{ marginRight: '10px' }} />                    {/* <div >

        <Text strong style={{color:"white"}}>Nishyan</Text>
        <Link href="https://ant.design" target="_blank"></Link>
        </div> */}
                    <Space direction="vertical">
                        <Text  style={{ color: "white" }}>Available credits</Text>
                        <Link href="https://ant.design" target="_blank" style={{ color: "white", fontSize: "12px", textDecoration: "underline" }}>
      Visit store
    </Link>
                    </Space>
                </div>

            </Sider>
            <Layout
                style={{
                    marginLeft: 0,
                }}
            >
                <Header
                    style={{
                        padding: 0,
                        margin: 0,
                        background: colorBgContainer,
                    }}
                />
                <Content
                    style={{
                        margin: '24px 16px 0',
                        overflow: 'initial',
                    }}
                >
                    {/* <div
            style={{
              padding: 24,
              textAlign: 'center',
              background: colorBgContainer,
              borderRadius: borderRadiusLG,
            }}
          >
            <p>long content</p>
            {
              // indicates very long content
              Array.from(
                {
                  length: 100,
                },
                (_, index) => (
                  <React.Fragment key={index}>
                    {index % 20 === 0 && index ? 'more' : '...'}
                    <br />
                  </React.Fragment>
                ),
              )
            }
          </div> */}
                </Content>
                {/* <Footer
          style={{
            textAlign: 'center',
          }}
        >
          Ant Design ©{new Date().getFullYear()} Created by Ant UED
        </Footer> */}
            </Layout>
        </Layout>
    );
};
export default Payments;
